    book1 = Product(seller_id=4, name="Think and Grow Rich: The Landmark Bestseller Now Revised and Updated for the 21st Century (Think and Grow Rich Series)", description = "Think and Grow Rich has been called the 'Granddaddy of All Motivational Literature.' It was the first book to boldly ask, 'What makes a winner?' The man who asked and listened for the answer, Napoleon Hill, is now counted in the top ranks of the world's winners himself.\nThe most famous of all teachers of success spent 'a fortune and the better part of a lifetime of effort' to produce the 'Law of Success' philosophy that forms the basis of his books and that is so powerfully summarized in this one.\nIn the original Think and Grow Rich, published in 1937, Hill draws on stories of Andrew Carnegie, Thomas Edison, Henry Ford, and other millionaires of his generation to illustrate his principles. In the updated version, Arthur R. Pell, Ph.D., a nationally known author, lecturer, and consultant in human resources management and an expert in applying Hill's thought, deftly interweaves anecdotes of how contemporary millionaires and billionaires, such as Bill Gates, Mary Kay Ash, Dave Thomas, and Sir John Templeton, achieved their wealth. Outmoded or arcane terminology and examples are faithfully refreshed to preclude any stumbling blocks to a new generation of readers.\n", category="Books", price="8.19", inventory=50, images =productImages22)
    book2 = Product(seller_id=5, name="The Book on Rental Property Investing: How to Create Wealth With Intelligent Buy and Hold Real Estate Investing (BiggerPockets Rental Kit, 2)", description = "Real estate investing can provide a safe and fast path to financial freedom, and this business best seller will show you exactly how to get there. With nearly 400 pages of in-depth advice, The Book on Rental Property Investing imparts practical and exciting strategies that real estate investors across the world are using to build significant cash flow with rental properties.\nBrandon Turner―active real estate investor, best-selling author, and co-host of the BiggerPockets Podcast―breaks down the time-tested strategies he used to build his own wealth in real estate. Whether you are just getting started or already own hundreds of units, you will learn how to create an achievable plan, find incredible deals, analyze properties, build a team, finance rentals, and much more―everything you need to become a millionaire rental property investor.\n", category="Books", price="17.79", inventory=50, images =productImages23)
    book3 = Product(seller_id=6, name="It Ends with Us: A Novel", description = "In this “brave and heartbreaking novel that digs its claws into you and doesn't let go, long after you've finished it (Anna Todd, New York Times bestselling author) from the #1 New York Times bestselling author of All Your Perfects, a workaholic with a too-good-to-be-true romance can't stop thinking about her first love.\nLily hasn't always had it easy, but that's never stopped her from working hard for the life she wants. She's come a long way from the small town where she grew up—she graduated from college, moved to Boston, and started her own business. And when she feels a spark with a gorgeous neurosurgeon named Ryle Kincaid, everything in Lily's life seems too good to be true.\nRyle is assertive, stubborn, maybe even a little arrogant. He's also sensitive, brilliant, and has a total soft spot for Lily. And the way he looks in scrubs certainly doesn't hurt. Lily can't get him out of her head. But Ryle's complete aversion to relationships is disturbing. Even as Lily finds herself becoming the exception to his 'no dating' rule, she can't help but wonder what made him that way in the first place.", category="Books", price="12.99", inventory=50, images =productImages24)
    book4 = Product(seller_id=7, name="The Psychology of Money: Timeless lessons on wealth, greed, and happiness", description = "Doing well with money isn't necessarily about what you know. It's about how you behave. And behavior is hard to teach, even to really smart people.\nMoney―investing, personal finance, and business decisions―is typically taught as a math-based field, where data and formulas tell us exactly what to do. But in the real world people don't make financial decisions on a spreadsheet. They make them at the dinner table, or in a meeting room, where personal history, your own unique view of the world, ego, pride, marketing, and odd incentives are scrambled together.\nIn The Psychology of Money, award-winning author Morgan Housel shares 19 short stories exploring the strange ways people think about money and teaches you how to make better sense of one of life's most important topics.", category="Books", price="13.40", inventory=50, images =productImages25)
    book5 = Product(seller_id=8, name="Atomic Habits: An Easy & Proven Way to Build Good Habits & Break Bad Ones", description = "The number one New York Times best seller. Over one million copies sold!\nNo matter your goals, Atomic Habits offers a proven framework for improving - every day. James Clear, one of the world's leading experts on habit formation, reveals practical strategies that will teach you exactly how to form good habits, break bad ones, and master the tiny behaviors that lead to remarkable results.\nIf you're having trouble changing your habits, the problem isn't you. The problem is your system. Bad habits repeat themselves again and again not because you don't want to change, but because you have the wrong system for change. You do not rise to the level of your goals. You fall to the level of your systems. Here, you'll get a proven system that can take you to new heights.\nClear is known for his ability to distill complex topics into simple behaviors that can be easily applied to daily life and work. Here, he draws on the most proven ideas from biology, psychology, and neuroscience to create an easy-to-understand guide for making good habits inevitable and bad habits impossible. Along the way, listeners will be inspired and entertained with true stories from Olympic gold medalists, award-winning artists, business leaders, life-saving physicians, and star comedians who have used the science of small habits to master their craft and vault to the top of their field.", category="Books", price="12.99", inventory=50, images =productImages26)

