    electronic1 = Product(seller_id=4, name="Compressed-air-dusters-electric-duster-100000RPM- air Blower for Computer - No Compressed air can - Replace Canned air dusters -Keyboard Cleaner - pc air dusters - Compressed air Electric", description = "Compressed Air Duster【Multi-use】: This air duster used for PC, computer cases, keyboard cleaner, camera, plant, car, pet hair, fans, lily windows, swimming rings, yoga balls, steamboats, air mattresses, etc.\nAir duster:【 5 nozzles and 3 brushes & LED Lights】comes better cleaning meet different needs. compressed air makes it easier to clean corners or place where hand cannot reach. LED lights automatically illuminate when turned on electric air duster, allowing you to easily clean up dark corners, bringing great convenience to your cleaning. air dusters use different equipment cleaning, so that dust has nowhere to stay.", category="Electronics", price="55.99", inventory=50, images =productImages40)
    electronic2 = Product(seller_id=5, name="Power Strip, ALESTOR Surge Protector with 12 Outlets and 4 USB Ports, 6 Feet Extension Cord (1875W/15A), 2700 Joules, ETL Listed, Black", description = "★Multi Function Power Strip:Power strip surge protector with 12AC outlets & 4 USB charging ports (5V/3.4A,17W), 6-foot Heavy Duty power extension cord(1875W/15A), surge protector (2700 Joules)with overload protection protects against spikes and fluctuations.Wide range voltage design, can be used on 120v to 240v circuit.\n★Surge Protector Power Strip with usb:2 Special design widely spacing AC outlets (2 inches) for large adapters with 10 standard spacing outlets,4 USB ports total 3.4 A/17W, each USB A port features 2.4A Max output. Built- with smart technology, detecting charging devices and deliver optimal charging speed automatically, compatible with Kindle and most USB devices.", category="Electronics", price="21.98", inventory=50, images =productImages41)
    electronic3 = Product(seller_id=6, name="Logitech C920e HD 1080p Mic-Enabled Webcam, certified for Zoom, Microsoft Teams compatible, TAA Compliant", description = "SUPPORT WORK FROM ANYWHERE WITH SYNC: Whether employees are in the office, at home, or somewhere else, Sync device management software helps everyone stay connected by letting you ensure their Logitech video collaboration personal devices are being used and up to date.\nWith a 78° fixed field of view, the C920e webcam displays individual users in a well-balanced frame, while also providing sufficient room to visually share projects and other items of interest.\nThe C920e webcam features two integrated omnidirectional microphones that capture your audio clearly from up to one meter away, so your voice always sounds natural and clear.\nBuilt-in HD autofocus ensures you're seen clearly throughout your video calls. With automatic light correction, C920e delivers optics that help you look good in all your video meetings.", category="Electronics", price="59.96", inventory=50, images =productImages42)
    electronic4 = Product(seller_id=7, name="Blink Mini Pan-Tilt Camera | Rotating indoor plug-in smart security camera, two-way audio, HD video, motion detection, Works with Alexa (White)", description = "See what's happening inside any room from corner to corner with 360° coverage from your smartphone, tablet, or compatible Alexa device.\nPan left and right and tilt up and down from the Blink app to see more of your home with HD day and infrared night view.\nGet real-time motion alerts on your smartphone so you can react and engage from anywhere.\nChoose to save and share clips in the cloud with a free 30-day trial of the Blink Subscription Plan or locally with the Sync Module 2 and USB drive (each sold separately).\nSee, hear, and speak to people and pets through the Blink app. Stream live video continuously for up to 90 minutes with a Blink Subscription Plan (sold separately).\nSet up by yourself in minutes — plug in the device, connect it to wifi, and follow the instructions in the Blink app.\nWorks with Alexa — stream HD live view, arm and disarm your camera, and more, when connected to Blink Mini.\nIncludes one Blink Mini camera, one Blink Mini Pan-Tilt Mount, one USB cable, and one power adapter.", category="Electronics", price="59.99", inventory=50, images =productImages43)
    electronic5 = Product(seller_id=8, name="Apple AirPods Pro (2nd Generation) Wireless Earbuds, Up to 2X More Active Noise Cancelling, Adaptive Transparency, Personalized Spatial Audio, MagSafe Charging Case, Bluetooth Headphones for iPhone", description = "RICHER AUDIO EXPERIENCE - The Apple-designed H2 chip pushes advanced audio performance even further, resulting in smarter noise cancellation and more immersive sound. The low-distortion, custom-built driver delivers crisp, clear high notes and deep, rich bass in stunning definition. So every sound is more vivid than ever..Note : If the size of the earbud tips does not match the size of your ear canals or the headset is not worn properly in your ears, you may not obtain the correct sound qualities or call performance. Change the earbud tips to ones that fit more snugly in your ear\nNEXT-LEVEL ACTIVE NOISE CANCELLATION - Up to 2x more Active Noise Cancellation than the previous AirPods Pro for dramatically less noise on your commute, or when you want to focus. Adaptive Transparency lets you comfortably hear the world around you, adjusting for intense noise—like sirens or construction—in real time.", category="Electronics", price="229.00", inventory=50, images =productImages44)

